import React from "react";
import { Jumbotron } from "reactstrap";


const Home=()=>{
    return (
    <div>
        <Jumbotron>
            <h1>
                Learn with Saumya
            </h1>
            <p>
                This project contains React Js as a front end and
                Java With Backend.
            </p>
        </Jumbotron>
    </div>
    );
};
export default Home;
